import './App.css';
import { Routes, Route } from "react-router-dom";

function App() {
  return (<>
    <Routes>
      <Route path='/' element={''}/>
      <Route path='/home' element={''}/>
      <Route path='/add-data' element={''}/>
      <h1>Hello</h1>
    </Routes>

  </>
  );
}

export default App;
